from pymongo import *
from Config import Configuration
import sys

MongoStore = Configuration().GetData()['MongoDB']
MongoIP = Configuration().GetData()['PrivateIp']
MonngoPort = Configuration().GetData()['MongoPort']
print('Current DB Configuration on Mongo for Codex:', MongoIP, MonngoPort, MongoStore)

def WriteValue(collectionName, KN, Value):
    try:
        client = MongoClient(MongoIP, MonngoPort)
        db = client[str(MongoStore)]
        collection = db[collectionName]
        post_data = {
            'Key': str(KN),
            'Data': str(Value)
        }
        collection.insert_one(post_data)
    except IOError as e:
        print("I/O error({0}): {1}".format(e.errno, e.strerror))
    except ValueError:
        print("Could not convert data to an integer.")
    except:
        print("Unexpected error:", sys.exc_info()[0])


def UpdateValue(collectionName,KN,Value):
    try:
        client = MongoClient(MongoIP, MonngoPort)
        db = client[str(MongoStore)]
        collection = db[collectionName]
        collection.update_one(
            {"Key": str(KN)},
            {
                "$set": {
                    "Data": str(Value)
                }
            },
            upsert=True
        )
    except Exception as e:
        return str(e)
        print(e)


def ReadValue(collectionName, KN):
    try:
        client = MongoClient(MongoIP, MonngoPort)
        db = client[str(MongoStore)]
        collection = db[collectionName]
        value = collection.find_one({'Key': str(KN)})
        return value
    except IOError as e:
        print("I/O error({0}): {1}".format(e.errno, e.strerror))
    except ValueError:
        print("Could not convert data to an integer.")
    except:
        print("Unexpected error:", sys.exc_info()[0])


def ReadAll(collectionName):
    try:
        client = MongoClient(MongoIP, MonngoPort)
        db = client[str(MongoStore)]
        collection = db[collectionName]
        value = collection.find({})
        return value
    except IOError as e:
        print("I/O error({0}): {1}".format(e.errno, e.strerror))
    except ValueError:
        print("Could not convert data to an integer.")
    except:
        print("Unexpected error:", sys.exc_info()[0])


def drop_collection(collection_name):
    try:
        client = MongoClient(MongoIP, MonngoPort)
        db = client[str(MongoStore)]
        collection = db[collection_name]
        return db.drop_collection(collection)
    except Exception as e:
        return str(e)

